Defendant is before the Court for sentencing, his probation having been revoked effective 05-07-2018.
The defendant is sentenced to the Wisconsin State Prison System for a total of five (5) years.  That is two (2) years initial confinement followed by three (3) years extended supervision.  
Conditions of extended supervision: 
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) AODA assessment and follow through;
3) Pay court costs;
4) pay supervision fees in an amount to be determined by DOC;
5) maintain absolute sobriety;
6) Maintain fulltime employment, schooling, combination;
7) Submit to random urine screens and pay for same;
The defendant has credit for 410 days
Any remaining financial obligations are to be paid through extended supervision. 
The Court finds the defendant eligible for both the Challenge Incarceration Program and the Substance Abuse Program.
Minutes.

